export class User {
  constructor(email, id, name, establishment, admin, manager, member, provider, autoUpdateDb, _token, _tokenExpirationDate) {
    this.email = email;
    this.id = id;
    this.name = name;
    this.establishment = establishment;
    this.admin = admin;
    this.manager = manager;
    this.member = member;
    this.provider = provider;
    this.autoUpdateDb = autoUpdateDb;
    this._token = _token;
    this._tokenExpirationDate = _tokenExpirationDate;
  }

  get token() {
    if (!this._tokenExpirationDate || new Date() > this._tokenExpirationDate) {
      return null;
    }

    return this._token;
  }

  get tokenExpiration() {
    return this.tokenExpiration;
  }

  set setUsername(username) {
    this.name = username;
    this.updateLocalStorage();
  }

  set setAutoUpdate(value) {
    this.autoUpdateDb = value;
    this.updateLocalStorage();
  }

  set setEst(est) {
    this.establishment = est;
    this.updateLocalStorage();
  }

  updateLocalStorage() {
    localStorage.setItem('userData', JSON.stringify(this));
  }

}
